import React, { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUserCircle } from '@fortawesome/free-solid-svg-icons'
import "./Doctor.css";

function DoctorComponent() {

  const patientAddress = "0x12345678901234......567890"; //Address of the patient

  const recentApprovals = [
    "0x123456.......890abcdef12345678",
    "0xabcdef........99567890abcdef12",
    "0x7890ab........kef1234567890abcd",
    "0x12345n........56890abcdef123458",
    "0x123456.......890abcdef12345678",
    "0xabcdef........99567890abcdef12",
    "0x7890ab........kef1234567890abcd",
    "0x12345n........56890abcdef1234578",
  ];

  const timelineData = [
    {
      date: "January 2022",
      title: "Annual Physical Exam",
      description: "Routine checkup with primary care physician",
    },

    {
      date: "November 2021",
      title: "Emergency Room Visit",
      description:
        "Admitted for chest pain; discharged after tests showed no major issues",
    },  

    {
        date: "Somemonth 2022",
        title: "Annual Physical Exam",
        description: "Routine checkup with primary care physician",
      },

      {
        date: "Somemonth 2021",
        title: "Emergency Room Visit",
        description:
          "Admitted for chest pain; discharged after tests showed no major issues",
      },   

      {
        date: "Somemonth 2022",
        title: "Annual Physical Exam",
        description: "Routine checkup with primary care physician",
      },

      {
        date: "Somemonth 2021",
        title: "Emergency Room Visit",
        description:
          "Admitted for chest pain; discharged after tests showed no major issues",
      }, 
      {
        date: "Somemonth 2022",
        title: "Annual Physical Exam",
        description: "Routine checkup with primary care physician",
      },

      {
        date: "Somemonth 2021",
        title: "Emergency Room Visit",
        description:
          "Admitted for chest pain; discharged after tests showed no major issues",
      }, 
  ];

  return (
    <div className="doctor-body-container">
      <div class="doctor-container">

        {/* Timel of the patient medical history */}
        <div className="approval-container">
          <div class="approval-header"> Pending Requests Need Action! </div>
          <div class="approval-timeline">
              <h1> Add Doctor addresses</h1>
              <h2> Address 1</h2>
              <h2> Address 2</h2>
              <h2> Address 3</h2>
              <h2> Address 4</h2>
              <h2> Address 1</h2>
              <h2> Address 2</h2>
              <h2> Address 3</h2>
              <h2> Address 4</h2>
              <h2> Address 1</h2>
              <h2> Address 2</h2>
              <h2> Address 3</h2>
              <h2> Address 4</h2>
          </div>
        </div>

        {/* Profile of the patient */}
        <div className="profile-container">
          <div className="userdetails">
          <div className="address-text">{patientAddress}
          <div className="profile-icon">
            <FontAwesomeIcon icon={faUserCircle} size="5x" />
          </div>

          <div className="recent-approvals">
              <p>Recent Approvals:</p>
              <ul className="approved_addresses">
                {recentApprovals.map((address, index) => (
                  <li key={index}>{address}</li>
                ))}
              </ul>
            </div>
          </div>
          </div>       
        </div>
      </div>
    </div>
  );
}

export default DoctorComponent;
